 public void write(ExtendedDataOutput out, String string) throws IOException{  return;    }  synchronized (stringToID)     {  Integer id = stringToID.get(string);  if (id == null)       {  lastID += client ? 1 : -1;  stringToID.put(string, lastID);  idToString.put(lastID, string);  writeInt(out, STRING_FOLLOWS);  writeInt(out, lastID);  writeString(out, string);       }  else       {  writeInt(out, id);       }     } 
